const app = getApp();
import {
  formatTime,
  formatDate,
  TODOList
} from "../../utils/util.js";
import {
  BMapWX
} from './bmap-wx.js';

Page({
  data: {
    time: ' ',
    date: ' ',
    weatherData: ' ',
    list: [],
    title_jpg:"data:image/jpg;base64,",
    weather_jpg:"data:image/jpg;base64,"
  },
  

  onLoad: function (options) {
    wx.requestSubscribeMessage({
      tmplIds: ['aZzTkMDanrNDI4XyLGmg2I0-rMme4-IhyH0ws8zNYw8'],
      success(res) {}
    })
    var TIME = formatTime(new Date());
    var DATE = formatDate(new Date());
    this.setData({
      time: TIME,
      date: DATE,
    });

    var that = this;
    // 新建百度地图对象 
    var BMap = new BMapWX({
      ak: 'jGNUvvX5Xujv1pTlCZLUkwHaiNGfi1PY'
    });
    var fail = function (data) {
      console.log(data)
    };
    var success = function (data) {
      var weatherData = data.currentWeather[0];
      weatherData = '城市：' + weatherData.currentCity + '\n' + 'PM2.5：' + weatherData.pm25 + '\n' + '日期：' + weatherData.date + '\n' + '温度：' + weatherData.temperature + '\n' + '天气：' + weatherData.weatherDesc + '\n' + '风力：' + weatherData.wind + '\n';
      that.setData({
        weatherData: weatherData
      });
    }
    // 发起weather请求 
    BMap.weather({
      fail: fail,
      success: success
    });

  },


  getval(e) {
    this.setData({
      val: e.detail.value.replace(/^\s+|\s+$/g, "")
    })
  },

  add() {
    var new_data = this.data.list;
    if (this.data.val != '' && this.data.val != ' ') {
      new_data.push(this.data.val)
      this.setData({
        list: new_data,
        val: ''
      })
      app.globalData.userdata['list'] = this.data.list
      TODOList()
    }
  },

  del(e) {
    var i = e.target.dataset.index;
    var del_data = this.data.list;
    del_data.splice(i, 1)
    this.setData({
      list: del_data
    })

    app.globalData.userdata['list'] = this.data.list
    TODOList()
  },

  complete(e) {
    var i = e.target.dataset.index;
    var com_data = this.data.list;
    com_data.splice(i, 1)
    this.setData({
      list: com_data
    })
    app.globalData.userdata['list'] = this.data.list
    TODOList()
  },
})